import { BrowserRouter, Route } from 'react-router-dom';
import './App.css';
import NotesList from './components/NotesList';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route exact path="/" Component={NotesList}/>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
